import React from 'react';
import Slider from 'react-slick';
import s from './Portfolio.module.css';
import review1 from '../../reviewsImage/review1';
const Portfolio = ()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
    };
    return(
        <div className={s.portfolioSlider}>
<Slider {...settings}>
<div>
    <h3>1</h3>
</div>
<div>
    <h3>2</h3>
</div>
<div>
    <h3>3</h3>
</div>
<div>
    <h3>4</h3>
</div>
</Slider>
</div>
    );
};

export default Portfolio;
